(6, NULL, 13, '<table class=\"main\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"center\" style=\"width: 600px; border-spacing: 0px; border-collapse: collapse; text-size-adjust: 100%;\" data-last-type=\"background\">\n                <tbody>\n                    <tr>\n                        <td align=\"center\" class=\"image image-full element-content\" contenteditable=\"true\" style=\"padding: 0px; border-collapse: collapse; text-size-adjust: 100%;\">\n                            <img class=\"content-image \" style=\"width: 100%;\" src=\"https://cotginanalytics.net/dev/tech-crm/template-builder/uploads/upload-file-114973112023.png\">\n                        </td>\n                    </tr>\n                </tbody>\n            </table>', '2023-11-03 00:55:15'),
(7, NULL, 3, '<table class=\"main\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"background-color: rgb(255, 255, 255); width: 600px; border-spacing: 0px; border-collapse: collapse; text-size-adjust: 100%;\" align=\"center\" data-last-type=\"background\">\n                <tbody>\n                    <tr>\n                        <td class=\"element-content\" align=\"left\" style=\"padding: 10px 50px; font-family: Arial; font-size: 13px; color: rgb(0, 0, 0); line-height: 22px; border-collapse: collapse; text-size-adjust: 100%; background-color: rgb(255, 32, 43);\">\n                            <div contenteditable=\"true\" class=\"test-text\"><p><span style=\"color: rgb(255, 255, 255);\" data-mce-style=\"color: #ffffff;\">\n                                Dear ${Contacts.First Name} ${Contacts.Last Name},</span> </p><p><span style=\"color: rgb(255, 255, 255);\" data-mce-style=\"color: #ffffff;\">During this holiday season, our thoughts turn gratefully to those who have made our success possible. It is in this spirit that we say thank you and best wishes for the holidays and New Year.</span></p></div>\n                        </td>\n                    </tr>\n                </tbody>\n            </table>', '2023-11-03 00:55:15'),
(8, NULL, 3, '<table class=\"main\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"background-color: rgb(255, 255, 255); width: 600px; border-spacing: 0px; border-collapse: collapse; text-size-adjust: 100%;\" align=\"center\" data-last-type=\"background\">\n                <tbody>\n                    <tr>\n                        <td class=\"element-content\" align=\"left\" style=\"padding: 10px 50px; font-family: Arial; font-size: 13px; color: rgb(0, 0, 0); line-height: 22px; border-collapse: collapse; text-size-adjust: 100%; background-color: rgb(255, 32, 43);\">\n                            <div contenteditable=\"true\" class=\"test-text\"><p><span style=\"color: rgb(255, 255, 255);\" data-mce-style=\"color: #ffffff;\">\n                                Further, we would like to inform you that we will be available during our working hours to serve our customers, and giving a great offer which is discounts upto 20% on any product or service.</span></p><p><span style=\"color: rgb(255, 255, 255);\" data-mce-style=\"color: #ffffff;\">You can feel free to book an appointment for your monthly service and can also directly call us for any help needed.\n                            </span></p></div>\n                        </td>\n                    </tr>\n                </tbody>\n            </table>', '2023-11-03 00:55:15'),
